import React, { Component } from 'react'

import {
  ProjectContainer,
  ProjectImage,
  TechContainer,
  TechTag,
  LinkContainer
} from './Project.styles'

class Project extends Component {
  render() {
    const tech = this.props.tech

    return (
      <ProjectContainer>
        <ProjectImage src={this.props.source} />
        <h3>{this.props.name}</h3>
        <TechContainer>
          {tech.map(function(item) {
            return <TechTag>{item}</TechTag>
          })}
        </TechContainer>
        <LinkContainer>
          <Link href={this.props.repo}>View Code</Link>
          <Link href={this.props.demo}>View Live Demo</Link>
        </LinkContainer>
      </ProjectContainer>
    )
  }
}

export default Project
